css:
@-moz-document domain(youtube.com) {
  /*Amogus*/
  .html5-play-progress,
  .ytp-play-progress {
      background: linear-gradient(#767cb8 50%, #ffffff 50%);;
  }



  .html5-scrubber-button,
  .ytp-scrubber-button {
      background: url("https://nukocities.neocities.org/nuko/act/cat200.gif") !important;
      width: 30px !important;
      height: 40px !important;
      margin-left: -12px !important;
      margin-top: -15px !important;
  }



  .html5-progress-list,
  .ytp-progress-list,
  .video-ads .html5-progress-list.html5-ad-progress-list,
  .video-ads .ytp-progress-list.ytp-ad-progress-list {
      height: 10px !important;
  }
}
